var qiniu = require("qiniu");
var async=require('asyncawait/async');
var await=require('asyncawait/await');
var urllib = require('urllib');
var request=require("request");
var config=require("./config");

qiniu.conf.ACCESS_KEY = 'XXXX';
qiniu.conf.SECRET_KEY = 'XXXX';

var bucket = 'panop';
var key="aa.jpg";

 function urlsafeBase64Encode(jsonFlags) {
    var encoded = new Buffer(jsonFlags).toString('base64');
    return encoded.replace(/\//g, '_').replace(/\+/g, '-');
}

var keybase64=urlsafeBase64Encode(key);
var base64img="";
var url = 'http://up.qiniu.com/putb64/-1/key/'+keybase64;
//构建上传策略函数
function uptoken(bucket, key) {
        var putPolicy = new qiniu.rs.PutPolicy(bucket+":"+key);
        return putPolicy.token();
}

var token=uptoken(bucket,key);
console.log(token)
var options = {
    url: url,
    method: 'POST',
    body: base64img,
    headers: {
        "Content-Type": "application/octet-stream",
        "Authorization": "UpToken " + token
    }
};

function callback(error, response, body) {
    if (!error && response.statusCode == 200) {
       console.log("上传成功");
    }
}

request(options,callback)

